import React, { useEffect, useState } from "react";
import {
  View,
  Text,
  Pressable,
  Image,
  Platform,
  ScrollView,
  TextInput,
} from "react-native";
import { Modal, Portal, Button, Provider , Divider } from 'react-native-paper';
import auth from "../../lib/api/auth";
import { LinearGradient } from "expo-linear-gradient";
import {
  fontPixel,
  heightPixel,
  pixelSizeHorizontal,
  pixelSizeVertical,
} from '../../lib/style/adjust';
import { useSafeAreaInsets } from "react-native-safe-area-context";
import FocusAwareStatusBar from "../../Components/common/FocusAwareStatusBar";



const ViewCitation = ({ navigation }) => {
  const [data, setData] = useState([]);
  const getCitation = async () => {
      // setSearchData(!SearchData)
      const response = await auth.post("user/getCitation");
      setData(response.data);
      console.log(response.data);
  }
  useEffect(() => {
      getCitation();

  }, []);
  const insets = useSafeAreaInsets();
  const [visible, setVisible] = React.useState(false);

  const showModal = () => setVisible(true);
  const hideModal = () => setVisible(false);
  const containerStyle = {backgroundColor: 'white', padding: 20};

  
  return (
    <View
      style={{
        paddingTop: 0,
        paddingBottom: insets.bottom,
        backgroundColor: "#FFFFFF",
        height:'100%'
      }}
    >
      <FocusAwareStatusBar
        translucent
        backgroundColor="transparent"
        barStyle="light-content"
      />
      <View
        style={{
          width: "90%",
          alignSelf: "center",
          marginBottom: 50,
          left: -10,
        }}
      >
        <View>
        <Text
            style={{
              alignSelf: "center",
              marginTop: 30,
              color: "black",
              fontSize: 16,
            }}
          >
            All Citations
          </Text>
         </View>
         <View style={{
            
         }}>
         {data.map((citation,index)=>(
          <View
          key={index}
            style={{
                // borderRadius: 10,
                flex: 1,
                width:'100%',
                alignSelf:'center',
                marginTop: pixelSizeVertical(15),
                height: heightPixel(370),
                marginLeft:10,
                ...Platform.select({
                    ios: {
                        shadowColor: 'rgba(0, 0, 0, 0.2)',
                        shadowOffset: {
                            width: 0,
                            height: 100,
                        },
                        shadowOpacity: 0.9,
                        shadowRadius: 20,
                    },
                    android: {
                        elevation: 20,
                        shadowOffset: {
                            width: 0,
                            height: 100,
                        },
                        shadowOpacity: 0.9,
                        shadowRadius: 20,
                    },
                }),
            }}>
            
            <LinearGradient
                colors={['#FFFFFF', '#FFFFFF']}
                style={{
                    padding: pixelSizeHorizontal(20),
                    justifyContent: 'space-between',
                    height: '100%',
                    borderColor: '#29406C',
                    borderWidth: 2,
                    borderRadius: 10
                }}>
                <Text
                    style={{
                        color: '#29406C' 
                    }
                    }>
                    Citation Name:
                </Text>
                <Text
                    style={{
                        color: '#29406C' 
                    }
                    }>
                    {citation?.clcName}
                </Text>
                <Divider 
                style={{
                  marginTop:0

                }}
                />
                <Text
                    style={{
                        color: '#29406C' 
                    }
                    }>
                    Title:
                </Text>
                <Text
                    style={{
                        color: '#29406C' 
                    }
                    }>
                    {citation?.title}
                </Text>
                <Divider 
                style={{
                  marginTop:0

                }}
                />
                <Text
                style={{
                    color: '#29406C' 
                }
                }>
                Tags:
            </Text>
            <Text
                    style={{
                        color: '#29406C' 
                    }
                    }>
                    {citation?.tags}
                </Text>
            <Divider 
            style={{
              marginTop:0

            }}
            />
            <Text
                style={{
                    color: '#29406C' 
                }
                }>
                Head Notes:
            </Text>
            <Text
                    style={{
                        color: '#29406C' 
                    }
                    }>
                    {citation?.headNotes}
                </Text>
            <Divider 
            style={{
              marginTop:0

            }}
            />
        <Modal visible={visible} onDismiss={hideModal} contentContainerStyle={containerStyle}>
          <ScrollView>
          <Text>Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.Example Modal.  Click outside this area to dismiss.</Text>
          </ScrollView>
        </Modal>
      <View 
      style={{
        display:'flex',
        flexDirection:'row',
        justifyContent:'space-between'

      }}
      >
      <Button  mode="contained" style={{
            width: "49%",
            marginTop: 20,
            padding: 5,
            alignSelf: "center",
            
          }} onPress={showModal}
          color="#244e78"
          >
       Head Notes
      </Button>
      <Button  mode="contained" style={{
            width: "49%",
            marginTop: 20,
            padding: 5,
            alignSelf: "center",
            
          }} onPress={showModal}
          color="#244e78"
          >
            Description
      </Button>
      </View>
            </LinearGradient>
            
       
    
        </View>
      

         ))}
         </View>
        </View>
    </View>
  );
};

export default ViewCitation;
